import React from 'react'
import ReactDOM from 'react-dom'
const root=ReactDOM.createRoot(document.getElementById('root'));
class Test extends React.Component{
  constructor(){
    super()
    this.state={
      'nme':'hi',
      'id':'sde'
    }
  }
  componentDidMount() {
    fetch(
"http://localhost:8080/")
        .then((res) => res.toString())
        .then((temp) => {
          alert(temp)
        })
}
  render(){
    return (
    <div>
      <h1>{this.state['nme']}</h1>
      <h2>{this.state['id']}</h2>
    </div>)
  }
}
root.render(<Test/>)
